BEGIN;

CREATE TABLE new_movies_staging (movieid INT, title VARCHAR(255), country CHAR(2), year INT, runtime INT);
CREATE TABLE new_people_staging (peopleid INT, first_name VARCHAR(255), surname VARCHAR(255), born INT, died INT, gender CHAR(1));
CREATE TABLE new_credits_staging (movieid INT, peopleid INT, credited_as CHAR(1));


COMMIT;

